export default (function(a,b,c,d,e,f,g,h,i){return {data:{tWYSODh1KS:{data:{id:1738,attributes:{imdbId:"tt0425123",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTk0Njk2OTY2N15BMl5BanBnXkFtZTcwNTAxNjAzMQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"55%"},{Source:"Metacritic",Value:"47\u002F100"}],item_lang:{data:{id:2401,attributes:{title:e,plot:"Elizabeth Masterson, a dedicated doctor in San Francisco, had almost no time for anything. When she gets into a tragic car crash and goes into a coma, a landscape architect moves into Elizabeth's apartment for rent - where he meets her amnesiac ethereal form.",slug:"just-like-heaven"}}},books:{data:[{id:8920,attributes:{title:f,description:g,thumbnail:h,authors:[a],firstBook:true,published:i,publisher:d,subtitle:b}},{id:8921,attributes:{title:f,description:g,thumbnail:h,authors:[a],firstBook:c,published:i,publisher:d,subtitle:b}},{id:8922,attributes:{title:"All Those Things We Never Said",description:"Kali ini Julia benar-benar tak bisa memaafkan ayahnya. Setelah bertahun-tahun mengabaikan dirinya, kini Anthony menggagalkan rencana pernikahannya. Bayangkan, di hari Julia seharusnya melangkah menuju pelaminan, muncul berita bahwa ayahnya meninggal! Beberapa hari kemudian, sebuah paket datang. Isinya sungguh luar biasa, tak pernah terbayangkan oleh Julia, atau siapa pun: manusia android yang sama persis dengan ayahnya. Entah apa tujuan Anthony menciptakan android semacam itu, yang jelas ia ingin memberikan sebuah kado istimewa bagi Julia, bukti cinta yang tak pernah ia ungkapkan selama masih hidup. Dan, ia hanya memiliki 6 hari untuk melakukannya. Kado istimewa apakah yang tengah disiapkan sang ayah? Siapkah Julia memberi maaf atas semua waktu yang hilang dan kekecewaan yang pernah ada? Sebuah novel manis yang penuh kejutan. [Mizan, Bentang, Terjemahan, Indonesia]",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tLhwZIk8r54C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2009-07-01",publisher:"Bentang Pustaka",subtitle:b}},{id:8923,attributes:{title:"If Only It Were True 2",description:"If life gave you a second chance to meet your first love again, would you risk everything to take it? If life gave you a second chance to meet your first love again, would you risk everything to take it? When Arthur returns to San Francisco after a self-imposed exile in Paris, he rediscovers his best friend, his job, and the city he loves. The one thing missing is Lauren: the woman he had sacrificed everything to save, only to lose her minutes later. Arthur is resigned to never see Lauren again. But when fate intervenes, it is Lauren's turn to save Arthur. If only she can find him in time. The sequel to Marc Levy's international bestseller If Only It Were True, this is an adventure that is by turns breathtaking and hilarious and a heart-warming love story that is impossible to forget. \"France's very own Dan Brown!' - Livres Hebdo",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=m4PTJYplMBgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2012-06-01",publisher:"Versilio",subtitle:b}},{id:8924,attributes:{title:e,description:"Arthur falls in love with Laura, the young woman he discovers in the closet of his San Francisco apartment whom only he can see, after she informs him that her body is in a coma across town, and when doctors prepare to end Lauren's medical care, it is up to Arthur to preserve their magical bond. Originally published as If Only It Were True. Reissue. (A DreamWorks Pictures film, releasing Fall 2005, starring Reese Witherspoon & Mark Ruffalo) (General Fiction)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=if8lQ_NmHiYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2005-01-01",publisher:d,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940961719}}("Marc Levy","",null,"Simon and Schuster","Just Like Heaven","If Only It Were True","What do you do when you find a stranger in your closet and she can disappear and reappear at whim? What if she then tells you that her body is actually in a coma on the other side of town? What starts off as a dilemma that Arthur is faced with when he discovers Lauren in his apartment, becomes a heartwarming love story.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BtNxkexU83MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2005-05-17"))